    return (
      <div className="App">

        <Toolbar />
        <Container style={{marginTop:'64px'}}>
          <Row style={{borderColor:'green'}}>
            <Col>
              <p>conteudo do site vem aqui em baixo. pode exportar outros componentes</p>

            </Col>

          </Row>


        </Container>
      </div>
    );
  }
}

export default App;
